    public void extracted(String unit, Category c, Product product, String name) {
        Property property = new Property();
        property.setProperty_name(name);
        property.setProperty_category(c);
        property.setProperty_category_id(c.getCategory_id());
        propertyMapper.insertOne(property);

        PropertyValue value = new PropertyValue();
        value.setPropertyValue_value(unit);
        value.setPropertyValue_property(property);
        value.setPropertyValue_product(product);
        propertyValueMapper.insertOne(value);
    }


